// DeleteUniqueIndexCache 删除索引存在的缓存
func (s *SysTenantRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.SysTenant) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, s.cache.Key(CacheSysTenantByConditionPrefix))
	keys = append(keys, s.cache.Key(CacheSysTenantUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[s.cache.Key(CacheSysTenantByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysTenantUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysTenantByNamePrefix, item.Name)] = struct{}{}
			KeyMap[s.cache.Key(CacheSysTenantUnscopedByNamePrefix, item.Name)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := s.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
